Promotional info - &quot;The mystery of the missing hand of Osiris and the search for the missing Jules leads Kaos Moon to travel to the ancient Egypt where she gets embroiled in the intrigues in the court of Seth. Will she be able to save Jules from becoming a sacrifice to the mighty Osiris and who is really behind the creation of the Egyptian gods? Nothing will ever be as before.&quot;

Thanks to Empire for this awesome digital copy. Please seed, and enjoy. 

